, "2020-04-23T14:50:41.983656423Z", "белый", "0", 2, 1, 4, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "48": ["Обычная китайская поделка, все болты раскручены, планки светодиодов прикручены на разные болты , вместо белого прислали синие , зачем они мне ? Мощность реальная в два раза ниже заявленной , сожалею что их купил, сами светодиоды крайне сильно греются ", "2020-04-23T06:51:36.381019372Z", "белый", "0", 4, 2, 1, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "49": ["Лампы ужасные! Установил на Субару Аутбэк в передние ПТФ. После установки стекла на ПТФ стали запотевать изнутри. Одна лампа стала мерцать на следующий день. Через 2 дня полностью погасла. Достал лампу - кристаллы диодов потрескались, подозрение, что от влажности - очень плохое уплотнение. \r\nПоставил обратно штатные галогеновые лампы, ПТФ отпотели, больше конденсат внутри не образуется.", "2020-04-22T19:31:19.128900543Z", "белый", "0", 1, 2, 1, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "50": ["Получил поставил, светят очень тускло, может брак, светят как габаритные лампочки", "2020-04-20T04:54:14.146746391Z", "белый", "0", 2, 1, 3, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "51": ["Классные лампочки. Брал под цоколь н11. Все подошло. Свет хороший. Качество на высоте. Всем рекомендую.", "2020-04-17T18:41:45.396051827Z", "белый", "0", 2, 1, 5, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "52": ["Лампы пришли быстро, посадочные лепестки отвалились сразу, пришло дорабатывать, отрезал от галогенок припаял к диодным железное кольцо с лепестками!)посмотрю как будет работать!!", "2020-04-14T12:10:58.593679201Z", "белый", "0", 1, 2, 4, "Светодиодные лампы D5 цоколь H11 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "53": ["Купил лампочки, приехала одна рабочая вторая нет. Пришлось разбирать оказалось что внутри один провод не прип